pragma solidity ^0.4.18;
import "zeppelin-solidity/contracts/ownership/Ownable.sol";
import "zeppelin-solidity/contracts/math/SafeMath.sol";
import "./Starting.sol";
import "./Stoppable.sol";
import "./helpers/HasManager.sol";
import "./helpers/Version.sol";
import "./interfaces/ICrowdsaleProcessor.sol";
import "./interfaces/IForecasting.sol";

contract CrowdsaleController is Ownable, Starting, Stoppable, HasManager, Version {
    using SafeMath for uint256;

    event CROWDSALE_PROCESSOR(address crowdsale, address token, address forecasting, uint256 ethRewardPart, uint256 tokenRewardPart, bool is3rdParty);
    event CROWDSALE_PROCESSOR_START(uint256 startTimestamp, uint256 endTimestamp, address fundingAddress);
    event CROWDSALE_PROCESSOR_STOP();
    event CROWDSALE_PROCESSOR_CLOSED_FORECASTING();

    /*
        Is 3rd party contract
    */
    bool public is3rdParty;

    /*
        Detect if forecasting closed
    */
    bool public forecastingClosed;

    /*
        Crowdsale processor and forecasting
    */
    ICrowdsaleProcessor public crowdsaleProcessor;
    IForecasting public forecasting;

    // Ether (optional) and token reward parts
    // in millionths of collected value and tokens sold respectively
    uint256 public ethRewardPart;
    uint256 public tokenRewardPart;

    /*
        Deadline timestamp to start crowdsale (end of forecasting period + 7 days)
    */
    uint256 public crowdsaleStartDeadline;

    /*
        Need to check time
    */
    function CrowdsaleController(
        uint256 _startDeadline,
        address _owner,
        address _manager,
        uint256 _ethRewardPart,
        uint256 _tokenRewardPart,
        address _crowdsaleProcessor,
        address _forecastingContract,
        bool _is3rdParty
    )
        public
        Version("1.0.0")
    {
        require(_tokenRewardPart > 0 && _ethRewardPart < 1000000 && _tokenRewardPart < 1000000);

        crowdsaleStartDeadline = _startDeadline;
        owner = _owner;
        manager = _manager;
        is3rdParty = _is3rdParty;

        ethRewardPart = _ethRewardPart;
        tokenRewardPart = _tokenRewardPart;

        crowdsaleProcessor = ICrowdsaleProcessor(_crowdsaleProcessor);

        forecasting = IForecasting(_forecastingContract);

        address token = crowdsaleProcessor.getToken();
        require(token != address(0));

        if (!_is3rdParty) {
            require(Ownable(token).owner() == _crowdsaleProcessor);
        }

        CROWDSALE_PROCESSOR(_crowdsaleProcessor, token, forecasting, _ethRewardPart, _tokenRewardPart, is3rdParty);
    }

    // you can start while forecasting closed
    // if no start - forecasting failed
    function closeIfNotStarted()
        public
        hasntStopped()
        hasntStarted()
    {
        if (block.timestamp > crowdsaleStartDeadline) {
            closeIfNotStartedImpl();
        }
    }

    // Max 7 days to start if it's not 3rd party contract (review time)
    function start(
        uint256 _startTimestamp,
        uint256 _endTimestamp,
        address _fundingAddress
    )
        public
        onlyOwner()
        hasntStopped()
        hasntStarted()
    {
        require(crowdsaleProcessor.manager() == address(this));
        require(forecasting.stage() == IForecasting.Stage.ReadyToMakeStats);

        if (block.timestamp > crowdsaleStartDeadline) {
            closeIfNotStartedImpl();
            return;
        }

        require(_startTimestamp <= crowdsaleStartDeadline);

        crowdsaleProcessor.start(_startTimestamp, _endTimestamp, _fundingAddress);
        super.start();

        CROWDSALE_PROCESSOR_START(_startTimestamp, _endTimestamp, _fundingAddress);
    }

    // Close forecasting
    function closeForecasting()
        public
    {
        require(!forecastingClosed);

        if (crowdsaleProcessor.isFailed()) {
            // failed stats
            forecasting.makeStats(crowdsaleProcessor.totalCollected(), 0, false);

            // transfer Wings deposit back to author
            forecasting.takeReward();

            forecastingClosed = true;
            CROWDSALE_PROCESSOR_CLOSED_FORECASTING();
            return;
        }

        require(crowdsaleProcessor.isSuccessful());

        uint256 tokenReward = crowdsaleProcessor.totalSold().mul(tokenRewardPart) / 1000000;
        uint256 ethReward;
        bool hasEthReward = (ethRewardPart != 0);

        uint256 totalCollected = crowdsaleProcessor.totalCollected();
        if (is3rdParty) {
            totalCollected = forecasting.fitCollectedValueIntoRange(totalCollected);
        }

        if (hasEthReward) {
            ethReward = totalCollected.mul(ethRewardPart) / 1000000;
        }

        forecasting.makeStats(totalCollected, hasEthReward ? ethReward : tokenReward, true);

        if (forecasting.stage() == IForecasting.Stage.RewardsDistributed) {
            if (hasEthReward) {
                crowdsaleProcessor.mintETHRewards(address(forecasting), ethReward);
            }

            // mint rewards for crowdsale
            crowdsaleProcessor.mintTokenRewards(forecasting, tokenReward);

            forecasting.prepareToGiveRewards(address(crowdsaleProcessor.getToken()), ethReward, tokenReward);
        } else {
            // transfer Wings deposit back to author
            forecasting.takeReward();
        }

        crowdsaleProcessor.releaseTokens();

        forecastingClosed = true;
        CROWDSALE_PROCESSOR_CLOSED_FORECASTING();
    }

    // Stop crowdsale
    // Only manager
    // HasntStopped yet
    // If crowdsale started and not completed yet
    function stop()
        public
        onlyManager()
        hasntStopped()
    {
        require(!crowdsaleProcessor.isFailed());
        require(!crowdsaleProcessor.isSuccessful());

        forecasting.stop();
        crowdsaleProcessor.stop();

        stopped = true;
        CROWDSALE_PROCESSOR_STOP();
    }

    // crowdsale failed: called if authors didn't start crowdsale during review period
    function closeIfNotStartedImpl() internal {
        forecasting.stop();
        forecastingClosed = true;
    }
}
